import React from 'react'

function Rect(props) {
    return (
        <div>
            <svg
                width = {props.width}
                height = {props.height}
                id = {props.key}>
                color = {props.color}
            </svg>
            <p>Colour: {props.color}</p>
            <p>Category: {props.category}</p>
            <hr/>
        </div>
    )
}

export default Rect
